import {BrowserRouter as Router,Route,Link} from "react-router-dom";
import React,{Component} from 'react';
import EmployeePersonalDetails from '../components/employee_master_personal';

export default class EmployeeMasterRoute extends Component{
    render(){
        return(
            <Router>
                    <div>
                        <Link to = {'/EmployeePersonalDetails'} className = 'm-3 border rounded-pill p-1 pl-4 pr-4'>Employee Master</Link>
                        <Route path = '/EmployeePersonalDetails' component = {EmployeePersonalDetails}/>
                    </div>
            </Router>
        )
    }
}
